import React from "react";
import Redirect from "react-dom";
import Dashboard from "./dashboard.component";

function SecuredRoute(props) {
  if (props.loggedInStatus === "NOT_LOGGED_IN") {
    return <Redirect to="/" />;
  } else {
    return <Dashboard {...props} />;
  }
}
